			shellPath = /bin/bash;
			shellScript = "#strip simulator architectures before copy frameworks\nif [ \"${CONFIGURATION}\" != \"Debug\" ]; then\n    cd \"${SRCROOT}/AppCanPlugin/uexFrameworks\"\n    rm -rf temp\n    mkdir temp\n    for a in `ls -d */`\n    do\n        folder=\"${a%%/*}\"\n        extension=\"${folder##*.}\"\n        if [ $extension != \"framework\" ]; then\n            continue\n        fi\n        framework=\"${folder%.*}\"\n        cp -rf \"${folder}\" \"temp/${folder}\"\n        info=$(lipo -info ${folder}/${framework} | sed 's/.*are: //')\n        if [[ $info == *\"i386\"* ]]; then\n            lipo -remove i386 \"${folder}/${framework}\" -output \"${folder}/${framework}\"\n        fi\n        if [[ $info == *\"x86_64\"* ]]; then\n            lipo -remove x86_64 \"${folder}/${framework}\" -output \"${folder}/${framework}\"\n        fi\n    done\nfi";
		};
